// src/components/FrontPage.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './FrontPage.css';

function FrontPage() {
  const navigate = useNavigate();

  return (
    <div className="front-page">
      {/* Logo */}
      <header className="header">
        <img src="/logo.png" alt="CSECU Logo" className="logo" />
      </header>

      {/* Welcome Message */}
      <section className="welcome-section">
        <h1 className="welcome-title" data-aos="fade-down">Welcome to the CSECU Family</h1>
        <p className="welcome-subtitle" data-aos="fade-up">
          Innovating the Future of Computer Science and Engineering
        </p>
        <div className="button-group" data-aos="zoom-in">
          <button className="btn primary" onClick={() => navigate('/signup')}>
            Sign Up
          </button>
          <button className="btn secondary" onClick={() => navigate('/login')}>
            Login
          </button>
        </div>
      </section>

      {/* CSE Features Section */}
      <section className="features-section">
        <div className="feature-card" data-aos="flip-left">
          <h3>Artificial Intelligence</h3>
          <p>Explore the world of AI and Machine Learning to create intelligent systems.</p>
        </div>
        <div className="feature-card" data-aos="flip-right">
          <h3>Cybersecurity</h3>
          <p>Secure the digital world by learning about ethical hacking and encryption.</p>
        </div>
        <div className="feature-card" data-aos="flip-up">
          <h3>Web Development</h3>
          <p>Design and develop modern, responsive websites and applications.</p>
        </div>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>Â© {new Date().getFullYear()} CSECU. All Rights Reserved.</p>
      </footer>
    </div>
  );
}

export default FrontPage;
